Me109 : One Summer - Two Messerschmitts

Technology Documentary with no narration published by Planes TV in 2006 - English language


Information
------------------------------

One summer there were 2 Messerschmitt 109 G's in residence at Duxford Airfield. Black 6, one of the worlds most authentic aircraft restorations and 109G &quot;Black 2&quot; flown by the Old Flying Machine Company. This film takes a look at both aircraft on the ground and in the air. There is also interviews with some of the team behind &quot;Black 6&quot; as well as an interview with a pilot who has flown both Spitfires and a 109. Highlights include a stunning 109 vs Spitfire dogfight sequence, amazing air-to air of &quot;Black 6&quot; and an in-cockpit camera. Featuring minimal commentary and maximum sound FX this is not a history of the ME109, but an up close and personal look at how these legendary aircraft are rebuilt and operated. If you've never been lucky enough to see a 109 fly, this is the next best thing.

